const SidebarItem = ( {icon }) => {
  return (
    <div>
      <div className="flex flex-row items-center space-x-2 p-2 hover:bg-gray-100 cursor-pointer">
        <span class="material-symbols-outlined">{icon}</span>
        <span>Home</span>
      </div>
    </div>
  );
};

export default SidebarItem;
